(1, '1660760098-57484307.jpg', '<h2 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; line-height: 42px; font-size: 35px; font-family: Poppins, sans-serif; color: var(--primary-heading);\"><span style=\"color: #000000;\">Experience Fassle Free Happiness.</span></h2>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #000000; font-size: inherit;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">We are an integrated logistics service company with a direct presence in more than 130 countries with our own offices.</strong></span></p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #000000;\">Our approach is to provide fast and effective solutions using a methodological structure that has been proven to increase efficiency, reduce costs and protect our clients in terms of their supply chain</span></p>\r\n<div class=\"span-bullets\" style=\"box-sizing: border-box; margin: 30px 0px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; color: #9dabaf;\">\r\n<ul style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; list-style: none;\">\r\n<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 32px; font-family: \'Open Sans\', sans-serif; color: var(--primary-heading);\"><span style=\"color: #000000;\">Security of packages transported.</span></li>\r\n<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 32px; font-family: \'Open Sans\', sans-serif; color: var(--primary-heading);\"><span style=\"color: #000000;\">Provide our employees environment.</span></li>\r\n<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 32px; font-family: \'Open Sans\', sans-serif; color: var(--primary-heading);\"><span style=\"color: #000000;\">Provide customer services.</span></li>\r\n</ul>\r\n</div>', '1660760047-58444681.jpg', '<h5 class=\"subtitle\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; line-height: 25px; font-size: 14px; font-family: \'Open Sans\', sans-serif; color: var(--secundary-color); text-transform: uppercase;\">BEYOND SPEED DELIVERY</h5>\r\n<h2 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; line-height: 42px; font-size: 35px; font-family: Poppins, sans-serif; color: var(--primary-heading);\"><span style=\"color: #ffffff;\">The New Logistic Revolutions</span></h2>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #ffffff; font-size: inherit;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">We are an integrated logistics service company with a direct presence in more than 130 countries with our own offices.</strong></span></p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 15px; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #ffffff;\">We evaluate the activities of our clients for the continuous improvement of processes, technology and human resources, thus ensuring total client satisfaction, complying with norms and standards.</span></p>\r\n<div class=\"row span-ws-layer\" style=\"box-sizing: border-box; margin: 30px -15px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; display: flex; flex-wrap: wrap; color: #9dabaf;\">\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 311.594px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"ws-box-layer\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px 0px 0px; border: 0px; font: inherit;\">\r\n<figure class=\"ha-icon\" style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; width: 50px;\"><span style=\"color: #ffffff; font-size: inherit;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; width: 50px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/warehouse.png\" alt=\"\" /></span></figure>\r\n<h5 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; line-height: 25px; font-size: 20px; font-family: \'Open Sans\', sans-serif; color: var(--secundary-color);\"><span style=\"color: #ffffff;\">Safe Warehousing</span></h5>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #ffffff;\">We care for providing our employees with a friendly environment.</span></p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 311.594px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"ws-box-layer\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px 0px 0px; border: 0px; font: inherit;\">\r\n<figure class=\"ha-icon\" style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; width: 50px;\"><span style=\"color: #ffffff; font-size: inherit;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; width: 50px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/shield.png\" alt=\"\" /></span></figure>\r\n<h5 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; line-height: 25px; font-size: 20px; font-family: \'Open Sans\', sans-serif; color: var(--secundary-color);\"><span style=\"color: #ffffff;\">Service Guarantee</span></h5>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; line-height: 25px; color: var(--paragraph-color);\"><span style=\"color: #ffffff;\">We Provide our customer with a friendly security guarantee.</span></p>\r\n</div>\r\n</div>\r\n</div>', 130, 2000, 100, 20);

