INSERT INTO `tb_blogs` (`id`, `title`, `author`, `date`, `image`, `details`, `short_details`, `status`) VALUES
(1, 'Shipping Survival Mode Crushing', 'Taylor O\'Ryan', '2022-08-17', '1660975226-56916671.jpg', '<p style=\"box-sizing: border-box; margin: 25px 0px; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Orders for big-ticket manufactured goods rebounded 0.5% in March as U.S. factories recovered from February weather disruptions. However, the recovery was not as strong as most had expected due to ongoing supply chain disruptions that continue.</p>\r\n<p style=\"box-sizing: border-box; margin: 25px 0px; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Even with the weaker-than-expected orders in March,&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: var(--primary-heading);\">economists are forecasting a strong economic</strong>&nbsp;growth in the January-March quarter. The releases its first look at gross domestic product.</p>\r\n<div class=\"blockquote\" style=\"box-sizing: border-box; margin: 30px 0px; padding: 30px; border-top: 0px; border-right: 0px; border-bottom: 0px; border-left: solid 5px var(--secundary-color); border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 1.25rem; line-height: inherit; font-family: \'Times New Roman\'; background-color: var(--background-color); position: relative; color: #9dabaf;\">\r\n<h4 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.5rem; font-weight: 500; line-height: 30px; font-family: Poppins, sans-serif; color: var(--primary-heading); font-style: italic; z-index: 1; position: relative;\">The global shipping industry has already been grappling with high costs and long waits because of virus related.</h4>\r\n</div>\r\n<p style=\"box-sizing: border-box; margin: 25px 0px; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Analysts at Contingent Macro said the durable goods report&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: var(--primary-heading);\">&ldquo;reveals significant volatility&rdquo;</strong>&nbsp;in certain industries due to the supply chain troubles, which have been particularly acute in the delivery of computer chips.</p>\r\n<p style=\"box-sizing: border-box; margin: 25px 0px; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">We evaluate the activities of our clients for the continuous improvement of processes, technology and human resources, thus ensuring total client satisfaction, complying with norms and standards.</p>\r\n<p style=\"box-sizing: border-box; margin: 25px 0px; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Our qualified human team guarantees you essential experience and professionalism, with a personalized service to solve any of your needs.</p>', 'Once both entities have arrived, the development and integration of a single port window will be promoted logistics segment revenue was primarily.', 1),
(2, 'Passenger Airlines Start Shifting', 'Olivia Tracy', '2022-08-18', '1660975317-31418764.jpg', '<p><span style=\"color: #020202; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">The logistics segment reported that Q1 revenue increased 20.9% to $1.82 billion from $1.44 billion last year. Operating income for the segment.</span></p>', 'The logistics segment reported that Q1 revenue increased 20.9% to $1.82 billion from $1.44 billion last year. Operating income for the segment.', 1),
(3, 'Reports Highest Quarterly Revenue Ever', 'Olivia Tracy', '2022-08-19', '1660975362-83408657.jpg', '<p><span style=\"color: #020202; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">In the first quarter, we reported the highest revenue of any quarter in our history, appreciably outpacing a macro that&rsquo;s recovering faster than expected.</span></p>', 'The increase in transportation operating income was related primarily to higher profitability in truck brokerage and in less-than-truckload operations.', 1);

