(1, 'Tracking', '1660758963-45833828.png', '1660758963-24003816.jpg', '<h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; line-height: 35px; font-size: 25px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Overview</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">We provide an integrated network of air and ground transport options that give you the widest range of air cargo choices all without having to make multiple calls to find the best rates.&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: var(--primary-heading);\">Air freight parcel delivery is the transfer and shipment</strong>&nbsp;of goods via an air carrier, which may be charter or commercial. Such shipments travel out of commercial and passenger aviation gateways to anywhere planes can fly and land.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Your shipment size and speed requirements are matched to the perfect aircraft, eliminating waste and reducing expenses. If your deadline does not support using a scheduled flight, your shipment can fly via a dedicated air cargo charter service. The express shipping options of air freight make it a valuable option for coordinating time sensitive shipments to almost anywhere in the world.</p>\r\n<figure class=\"freight-parallax\" style=\"box-sizing: border-box; margin: 50px 0px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; color: #9