(4, 'Railway Freight', '1660759272-73385226.png', '1660759272-3102179.jpg', '<h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; line-height: 35px; font-size: 25px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Overview</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">We provide an integrated network of air and ground transport options that give you the widest range of air cargo choices all without having to make multiple calls to find the best rates.&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: var(--primary-heading);\">Air freight parcel delivery is the transfer and shipment</strong>&nbsp;of goods via an air carrier, which may be charter or commercial. Such shipments travel out of commercial and passenger aviation gateways to anywhere planes can fly and land.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Your shipment size and speed requirements are matched to the perfect aircraft, eliminating waste and reducing expenses. If your deadline does not support using a scheduled flight, your shipment can fly via a dedicated air cargo charter service. The express shipping options of air freight make it a valuable option for coordinating time sensitive shipments to almost anywhere in the world.</p>\r\n<figure class=\"freight-parallax\" style=\"box-sizing: border-box; margin: 50px 0px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; color: #9dabaf;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 730px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/commons/logis-24.jpg\" alt=\"\" /></figure>\r\n<div class=\"freight-box\" style=\"box-sizing: border-box; margin: 0px 0px 50px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; box-shadow: rgba(6, 22, 58, 0.14) 0px 0px 11px 0px; color: #9dabaf;\">\r\n<div class=\"row no-gutters\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; display: flex; flex-wrap: wrap;\">\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; position: relative; width: 365px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"media\" style=\"box-sizing: border-box; margin: 0px; padding: 40px 30px; border: 0px; font: inherit; display: flex; align-items: flex-start;\">\r\n<figure class=\"fb-icon\" style=\"box-sizing: border-box; margin: 0px 15px 0px 0px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/warehouse.png\" alt=\"\" /></figure>\r\n<div class=\"media-body\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; flex: 1 1 0%;\">\r\n<h5 class=\"mt-0\" style=\"box-sizing: border-box; margin-bottom: 5px; line-height: 25px; font-size: 20px; font-family: \'Open Sans\', sans-serif; color: var(--primary-heading); margin-top: 0px !important;\">Safe Warehousing</h5>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: \'Open Sans\', sans-serif; line-height: 25px; color: var(--paragraph-color);\">With dedicated 24/7 customer service and detailed air cargo.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; position: relative; width: 365px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"media right-media\" style=\"box-sizing: border-box; margin: 0px; padding: 40px 30px; border: 0px; font: inherit; display: flex; align-items: flex-start; background-color: var(--primary-color);\">\r\n<div class=\"fb-circle\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit;\">\r\n<figure class=\"fb-icon\" style=\"box-sizing: border-box; margin: 0px 15px 0px 0px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/box-white.png\" alt=\"\" /></figure>\r\n</div>\r\n<div class=\"media-body\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font: inherit; flex: 1 1 0%;\">\r\n<h5 class=\"mt-0\" style=\"box-sizing: border-box; margin-bottom: 5px; line-height: 25px; font-size: 20px; font-family: \'Open Sans\', sans-serif; color: #ffffff; margin-top: 0px !important;\">Trusted Packaging</h5>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: \'Open Sans\', sans-serif; line-height: 25px; color: #ffffff;\">Ship your air cargo without breaking the bottom line.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<h3 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; line-height: 35px; font-size: 25px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Power Beyond Cargo</h3>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">For those air freight demands that are of the utmost priority, we offer next flight out shipping services. Combat crunch time while keeping your customers satisfied with either of these air cargo options.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Customs brokerage firms can determine the most reliable and cost-effective means for using air freight options to coordinate corporate, individual parcel or shipment deliveries. A customs broker can negotiate the vast array of options and determine the most applicable means to ensure expedient and on-time delivery.</p>\r\n<div class=\"row mt-4\" style=\"box-sizing: border-box; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: \'Times New Roman\'; display: flex; flex-wrap: wrap; color: #9dabaf; margin: 3rem !important -15px 0px -15px;\">\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 380px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"why-us-box aos-init aos-animate\" style=\"box-sizing: border-box; margin: 0px 0px 25px; padding: 25px; border: 0px; font: inherit; transform: translate(0px); background-color: var(--background-color); box-shadow: rgba(6, 22, 58, 0.14) 0px 0px 11px 0px; opacity: 1; transition-property: opacity, transform; transition-timing-function: ease; transition-duration: 1.2s;\" data-aos=\"fade-up\">\r\n<figure class=\"why-us-icon\" style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/international-shopping.png\" alt=\"\" /></figure>\r\n<h4 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 5px; line-height: 25px; font-size: 19px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">International Shipping</h4>\r\n<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">We have experience in home maintenance any surface from new cabinets.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 380px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"why-us-box aos-init aos-animate\" style=\"box-sizing: border-box; margin: 0px 0px 25px; padding: 25px; border: 0px; font: inherit; transform: translate(0px); background-color: var(--background-color); box-shadow: rgba(6, 22, 58, 0.14) 0px 0px 11px 0px; opacity: 1; transition-property: opacity, transform; transition-timing-function: ease; transition-duration: 1.2s;\" data-aos=\"fade-up\">\r\n<figure class=\"why-us-icon\" style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/packege-protection.png\" alt=\"\" /></figure>\r\n<h4 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 5px; line-height: 25px; font-size: 19px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Package Protection</h4>\r\n<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Security of packages transported by air and sea we guarantee total security.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 380px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"why-us-box aos-init aos-animate\" style=\"box-sizing: border-box; margin: 0px 0px 25px; padding: 25px; border: 0px; font: inherit; transform: translate(0px); background-color: var(--background-color); box-shadow: rgba(6, 22, 58, 0.14) 0px 0px 11px 0px; opacity: 1; transition-property: opacity, transform; transition-timing-function: ease; transition-duration: 1.2s;\" data-aos=\"fade-up\">\r\n<figure class=\"why-us-icon\" style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/package-tracking.png\" alt=\"\" /></figure>\r\n<h4 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 5px; line-height: 25px; font-size: 19px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Package Tracking</h4>\r\n<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Security of packages transported by air and sea Authorization and compliance.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 15px; border: 0px; font: inherit; position: relative; width: 380px; flex: 0 0 50%; max-width: 50%;\">\r\n<div class=\"why-us-box aos-init aos-animate\" style=\"box-sizing: border-box; margin: 0px 0px 25px; padding: 25px; border: 0px; font: inherit; transform: translate(0px); background-color: var(--background-color); box-shadow: rgba(6, 22, 58, 0.14) 0px 0px 11px 0px; opacity: 1; transition-property: opacity, transform; transition-timing-function: ease; transition-duration: 1.2s;\" data-aos=\"fade-up\">\r\n<figure class=\"why-us-icon\" style=\"box-sizing: border-box; margin: 0px 0px 5px; padding: 0px; border: 0px; font: inherit; width: 60px;\"><img style=\"box-sizing: border-box; vertical-align: middle; border: 0px; margin: 0px; padding: 0px; font: inherit; width: 60px;\" src=\"file:///D:/vmsl/sample%20theme%20references/speedex/quickdevs.com/demo/cargoy/images/icons/delivery-van.png\" alt=\"\" /></figure>\r\n<h4 style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 5px; line-height: 25px; font-size: 19px; font-family: Poppins, sans-serif; color: var(--primary-heading);\">Home Delivery</h4>\r\n<p style=\"box-sizing: border-box; margin-top: 10px; margin-bottom: 1rem; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 30px; color: var(--paragraph-color);\">Serve clients responsibly be an active community partner ethical standards.</p>\r\n</div>\r\n</div>\r\n</div>', 'We work with door-to-door product deliveries and offer comprehensive, quality customer solutions.', 1, 4);

